import './App.css';
import React from "react";
import MyHeader from "./MyHeader";
function App() {
    let adam = 'adam';
  return (
    <div className="App">
        <MyHeader/>
        <header className="App-header">
        <h2>Hello React (adam)</h2>
            <b id="bold_text"> React.js</b>
      </header>
    </div>
  );
}

export default App;
